import React from "react";
import PromotionCard from "./components/Promotion/Card";

const App = () => {
  const promotion = {
    title: "foda",
    price: "123",
    imageUrl:
      "https://cdn.gatry.com/gatry-static/promocao/imagem_url/2631517face1861bc4f46ae154d387de.png",
  };
  return (
    <div>
      <PromotionCard promotion={promotion} />
    </div>
  );
};
export default App;
